const abi = require("./abi.json");
const { ethers } = require('ethers') 

//paste tx input here and run  node decode.js
const input = ""

const iface = new ethers.utils.Interface(abi)
const functionSig = input.slice(0,10)
const frag = iface.getFunction(functionSig)
const txInputParsed = iface.decodeFunctionData(frag, input)



console.log(txInputParsed)